import java.io.*;
import java.util.*;

public class Main {
    static final int N = 12, M = 12, K = 6, S = 1000001;
    static int[][] a = new int[N][M];
    static int[][] dp = new int[N][1 << M];

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer st = new StringTokenizer(br.readLine());
        int n = Integer.parseInt(st.nextToken());
        int m = Integer.parseInt(st.nextToken());
        int k = Integer.parseInt(st.nextToken());
        int s = Integer.parseInt(st.nextToken());
        for (int i = 0; i < n; i++) {
            st = new StringTokenizer(br.readLine());
            for (int j = 0; j < m; j++) {
                a[i][j] = Integer.parseInt(st.nextToken());
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < (1 << m); j++) {
                dp[i][j] = S;
            }
        }
        dp[0][0] = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < (1 << m); j++) {
                for (int l = 0; l < m; l++) {
                    if ((j & (1 << l)) != 0) {
                        dp[i][j] = Math.min(dp[i][j], dp[i][j - (1 << l)] + a[i][l]);
                    }
                }
                for (int l = 0; l < m; l++) {
                    if ((j & (1 << l)) != 0) {
                        dp[i + 1][j - (1 << l)] = Math.min(dp[i + 1][j - (1 << l)], dp[i][j] + a[i][l]);
                    }
                }
            }
        }
        boolean flag = false;
        for (int i = 0; i < (1 << m); i++) {
            if (dp[n - 1][i] <= s) {
                flag = true;
                break;
            }
        }
        System.out.println(flag ? "Yes" : "No");
    }
}
